import React, { Component } from "react";
import "./Home.css";
import { MDBIcon, MDBCollapse } from "mdbreact";
import { render } from "react-dom";
import $ from "jquery";
import "bootstrap";
import "react-bootstrap";

export class Home extends Component {
  state = {
    collapseID: "",
    UsedcollapseID: "",
    PricecollapseID: "",
    DistanceCollapseID: "",
    YearcollapseID: "",
    BrandcollapseID: ""
  };

  toggleCollapse = collapseID => () => {
    this.setState(prevState => ({
      collapseID: prevState.collapseID !== collapseID ? collapseID : ""
    }));
  };

  toggleUsedCollapse = UsedcollapseID => () => {
    this.setState(prevState => ({
      UsedcollapseID:
        prevState.UsedcollapseID !== UsedcollapseID ? UsedcollapseID : ""
    }));
  };

  togglePriceCollapse = PricecollapseID => () => {
    this.setState(prevState => ({
      PricecollapseID:
        prevState.PricecollapseID !== PricecollapseID ? PricecollapseID : ""
    }));
  };

  toggleDistanceCollapse = DistancecollapseID => () => {
    this.setState(prevState => ({
      DistancecollapseID:
        prevState.DistancecollapseID !== DistancecollapseID
          ? DistancecollapseID
          : ""
    }));
  };

  toggleYearCollapse = YearcollapseID => () => {
    this.setState(prevState => ({
      YearcollapseID:
        prevState.YearcollapseID !== YearcollapseID ? YearcollapseID : ""
    }));
  };

  toggleBrandCollapse = BrandcollapseID => () => {
    this.setState(prevState => ({
      BrandcollapseID:
        prevState.BrandcollapseID !== BrandcollapseID ? BrandcollapseID : ""
    }));
  };

  render() {
    return (
      <div className="papa">
        <div className="jumbotron jumbotron-fluid jumbotron-search">
          <div className="container"></div>
        </div>
        <div className="container">
          <div class="input-group md-form form-sm form-2 pl-0">
            <input
              class="form-control my-0 py-1 light-blue-border"
              type="text"
              placeholder="Search"
              aria-label="Search"
            />
            <div class="input-group-append">
              <span
                class="input-group-text light-blue lighten-3"
                id="basic-text1"
              >
                <i class="fas fa-search text-grey" aria-hidden="true"></i>
              </span>
            </div>
            <div class="input-group-append">
              <span
                class="input-group-text light-blue lighten-3 m-xs-right btn"
                data-toggle="collapse"
                href="#menuExample"
                role="button"
                aria-expanded="false"
                aria-controls="menuExample"
                onClick={this.toggleCollapse("basicCollapse")}
                style={{ marginBottom: "1rem" }}
              >
                <i class="fas fa-tasks text-grey" aria-hidden="true">
                  &nbsp;
                </i>
                Filters
              </span>
            </div>
          </div>
          <div
            class="collapse show"
            id="menuExample"
            isOpen={this.state.collapseID}
          >
            <div className="row">
              <div className="col">
                <div>
                  <button
                    class="btn btn-primary"
                    type="button"
                    data-toggle="collapse"
                    data-target="#collapseExample"
                    aria-expanded="false"
                    aria-controls="collapseExample"
                  >
                    New/Used
                  </button>
                </div>
                <div class="collapse show" id="collapseExample">
                  <div class="card card-body">
                    <div class="custom-control custom-checkbox custom-control-inline">
                      <input
                        type="checkbox"
                        class="custom-control-input"
                        id="defaultInline1"
                      />
                      <label class="custom-control-label" for="defaultInline1">
                        1
                      </label>
                    </div>
                    <div class="custom-control custom-checkbox custom-control-inline">
                      <input
                        type="checkbox"
                        class="custom-control-input"
                        id="defaultInline2"
                      />
                      <label class="custom-control-label" for="defaultInline2">
                        2
                      </label>
                    </div>
                    <div class="custom-control custom-checkbox custom-control-inline">
                      <input
                        type="checkbox"
                        class="custom-control-input"
                        id="defaultInline3"
                      />
                      <label class="custom-control-label" for="defaultInline3">
                        3
                      </label>
                    </div>
                  </div>
                </div>
              </div>
              <div className="col">
                <div
                  className="btn btn-primary"
                  onClick={this.togglePriceCollapse("PriceCollapse")}
                  style={{ marginBottom: "1rem" }}
                >
                  Price&nbsp;<i class="fas fa-caret-down"></i>
                </div>
                <div
                  class="collapse show"
                  id="PriceCollapse"
                  isOpen={this.state.PricecollapseID}
                >
                  <form>
                    <div class="form-group">
                      <label for="formControlRange">Price range</label>
                      <input
                        type="range"
                        class="form-control-range"
                        id="formControlRange"
                      />
                    </div>
                  </form>
                </div>
              </div>
              <div className="col">
                <div
                  className="btn btn-primary"
                  onClick={this.toggleDistanceCollapse("DistanceCollapse")}
                  style={{ marginBottom: "1rem" }}
                >
                  Distance&nbsp;<i class="fas fa-caret-down"></i>
                </div>
                <div
                  className="collapse show"
                  id="DistanceCollapse"
                  isOpen={this.state.DistancecollapseID}
                >
                  zhopa
                </div>
              </div>
              <div className="col">
                <div
                  className="btn btn-primary"
                  onClick={this.toggleYearCollapse("YearCollapse")}
                  style={{ marginBottom: "1rem" }}
                >
                  Year&nbsp;<i class="fas fa-caret-down"></i>
                </div>
                <div
                  class="collapse show"
                  id="YearCollapse"
                  isOpen={this.state.YearcollapseID}
                >
                  zhopa
                </div>
              </div>
            </div>
            <div className="row">
              <div className="col">
                <div
                  className="btn btn-primary"
                  onClick={this.toggleBrandCollapse("BrandCollapse")}
                  style={{ marginBottom: "1rem" }}
                >
                  Brand&nbsp;<i class="fas fa-caret-down"></i>
                </div>
                <MDBCollapse
                  className="show"
                  id="BrandCollapse"
                  isOpen={this.state.BrandcollapseID}
                >
                  zhopa
                </MDBCollapse>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
